import React from "react";
import { Header, Container } from 'semantic-ui-react';

function CrossCountry() {
  return (
      <Container>
        <br/>
        <Header as ="h2" textAlign="center">Algo-Trix</Header>
        <Container text>
          <hr/>
        </Container>
      </Container>
  );
}

export default CrossCountry;
